body:
**Describe the bug**
Successful compile and run float16 model, but gives wrong predict results.（float32 model all right）.

**System information**
- OS Platform and Distribution:CentOS Linux release 7.5.1804
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: master
- Python version: 3.7
- Visual Studio version (if applicable): None
- GCC/Compiler version: gcc (GCC) 4.8.5 
- CUDA/cuDNN version: None
- GPU model and memory: None

**To Reproduce**
```c++
void BFloat16ToFloat(const uint16_t* src, float* dst, size_t size) 
{
    const uint16_t* p = reinterpret_cast<const uint16_t*>(src);
    uint16_t* q = reinterpret_cast<uint16_t*>(dst);
#if __BYTE_ORDER__ == __ORDER_BIG_ENDIAN__
  for (; size != 0; p++, q += 2, size--) 
  {
    q[0] = *p; 
    q[1] = 0;
  }
#else
  for (; size != 0; p++, q += 2, size--) 
  {
    q[0] = 0;
    q[1] = *p; 
  }
#endif
}

void doinference()
{
    // PREPARE INPUTS AND CREATE ENVS,SESSION
    ......
    // SESSION RUN
    auto output_values = pp_session_->Run(Ort::RunOptions{nullptr}, input_node_names.data(), input_tensors, 3, output_node_names.data(), 1);

    // output frame size    
    auto out_info = output_values[0].GetTensorTypeAndShapeInfo();
    ONNXTensorElementDataType type_ = out_info.GetElementType();
    printf("--------------------type=%d\n", type_);    // got 10(float 16)
    acoustic_len_ = out_info.GetShape()[1];

    uint16_t* outputs_16 = output_values[0].GetTensorMutableData<uint16_t>();
    outputs_ = new float [22*acoustic_len_];
    BFloat16ToFloat(outputs_16, outputs_, 22*acoustic_len_);
}
```

**Expected behavior**
Get right predict results.
